  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 22,421,178 people above the age of 16 who are currently eligible for the vaccine. As of Apr 13, 2021, the state has:


   | Fully Vaccinated: 5,962,723 people or 27% of the population 16+  | Vaccinated w/ At Least One Dose: 9,563,133 people or 43% of the population 16+  | Administered: 70,983 doses in one day on Apr 13, 2021 or 0.32% of the population 16+  | A 7-Day Average of 210,510 administered per day or 0.94% of the population 16+



